nl_NL:
Voer de volgende stappen uit om weg te varen van het vlot en over de ster heen te varen

1) {PeddelendStrijkenSB} : eindig met {Bedankt} als er genoeg ruimte is om de riemen uit te brengen 
2) {UitbrengenSB} 
3) {StrijkenBB} : als de boot weer recht licht eindig met {Bedankt} 
4) {SlagklaarAf} om weg te varen.

nl:
Voer de volgende stappen uit om weg te varen van het vlot en over de ster heen te varen

1) {PeddelendStrijkenSB} : eindig met {Bedankt} als er genoeg ruimte is om de riemen uit te brengen 
2) {UitbrengenSB} 
3) {StrijkenBB} : als de boot weer recht licht eindig met {Bedankt} 
4) {SlagklaarAf} om weg te varen.

en:
Perform the following steps to depart from the float. Sail over the star to end the practice.

1) {PeddelendStrijkenSB} : and end with {Bedankt}  if there is enough space to bring out the oars 
2) {UitbrengenSB} 
3) {StrijkenBB} : when the boat is parallel to the float {Bedankt} 
4) {SlagklaarAf} to depart.

